@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix : <http://www.example.com/> .

:PatientManagementSystem a owl:Class .

:Patient a owl:Class ;
  rdfs:subClassOf :PatientManagementSystem .

:Record a owl:Class ;
  rdfs:subClassOf :PatientManagementSystem .

:VitalSigns a owl:Class ;
  rdfs:subClassOf :Record .

:hasVitalSigns a rdf:Property ;
  rdfs:domain :Patient ;
  rdfs:range :VitalSigns .

:TimeInterval a owl:Class ;
  rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :hasVitalSigns ;
    owl:hasValue "5"^^xsd:integer ;
    owl:allValuesFrom xsd:integer ;
  ] .
